syntax = "proto3";
package persistence.schema.types.base.v1beta1;

import "third_party/proto/gogoproto/gogo.proto";

option go_package = "schema/types/base";

message metaProperties {
  option (gogoproto.goproto_getters) = false;
  option (gogoproto.equal) = false;

  repeated string MetaPropertyList = 1 [(gogoproto.customtype) = "github.com/persistenceOne/persistenceSDK/schema/types.MetaProperty", (gogoproto.nullable) = false] ;
}